import React from 'react';
import './tailor.css';

const Tailor = () => {
    return (
<section className='tailor container__content-full-fixedHeight'>
<div class='tailor__background'>
    <img src='https://drive.google.com/uc?export=view&id=1ZDgoFk7sYlHEpzAobEokxcc1P43qfHC5'></img>
</div>
<div className='tailor__top'>
    <h3>繪畫定製</h3>
    適合用作禮物，家中掛飾收藏
    媒介：素描、水彩、粉彩、油畫
    題材：人物 動物 風景、靜物、創作
    <btn>歡迎查詢！</btn>
</div>
</section>
    )
}

export default Tailor
